import { useState, useEffect } from "react";
import { tradeService } from "../services/tradeService";
import { aiService } from "../services/aiService";
import { trades as mockTrades } from "../data/mockData";
import "../styles/styles.css";

function Journal({ onAddTrade }) {
  const [trades, setTrades] = useState([]);
  const [loading, setLoading] = useState(true);
  const [filter, setFilter] = useState("ALL");
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchTrades = async () => {
      try {
        setLoading(true);
        const response = await tradeService.getAllTrades();
        const tradesData = response.data || response.trades || [];
        console.log('Fetched trades:', tradesData);
        console.log('Trade with screenshot:', tradesData.find(t => t.screenshotUrl));
        setTrades(tradesData);
      } catch (err) {
        console.error('Failed to fetch trades:', err);
        setTrades([]);
      } finally {
        setLoading(false);
      }
    };

    fetchTrades();

    // Make refresh function available globally
    window.refreshJournal = fetchTrades;

    // Cleanup
    return () => {
      delete window.refreshJournal;
    };
  }, []);

  const analyzeTrade = async (tradeId) => {
    try {
      const analysis = await aiService.getTradeAnalysis(tradeId);
      // Update the trade with AI analysis
      setTrades(prevTrades => 
        prevTrades.map(trade => 
          trade.id === tradeId || trade._id === tradeId 
            ? { ...trade, aiAnalysis: analysis, aiScore: analysis.qualityScore }
            : trade
        )
      );
      // Trigger a refresh of AI insights by calling a global refresh function
      if (window.refreshAIInsights) {
        window.refreshAIInsights();
      }
    } catch (err) {
      console.error('Failed to analyze trade:', err);
    }
  };

  const filtered = filter === "ALL" ? trades : trades.filter(t => t.status === filter);

  if (loading) {
    return (
      <div className="page">
        <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '400px' }}>
          <div>Loading trades...</div>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="page">
        <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '400px' }}>
          <div>{error}</div>
        </div>
      </div>
    );
  }

  return (
    <div className="page">
      <div style={{ display: "flex", alignItems: "center", justifyContent: "space-between", marginBottom: 20 }}>
        <div className="tabs">
          {["ALL", "WIN", "LOSS"].map(f => (
            <div key={f} className={`tab ${filter === f ? "active" : ""}`} onClick={() => setFilter(f)}>{f}</div>
          ))}
        </div>
        <button className="btn btn-primary" onClick={onAddTrade}>+ Log Trade</button>
      </div>

      <div className="card">
        <div className="table-wrap">
          <table>
            <thead>
              <tr>
                <th>Symbol</th><th>Dir</th><th>Entry</th><th>Exit</th>
                <th>PnL</th><th>R:R</th><th>Strategy</th><th>Emotion</th>
                <th>AI Score</th><th>Mistake</th><th>Screenshot</th><th>Actions</th><th>Date</th>
              </tr>
            </thead>
            <tbody>
              {filtered.map(t => (
                <tr key={t.id || t._id || Math.random()}>
                  <td><span className="symbol">{t.symbol}</span></td>
                  <td><span className={t.dir === "LONG" ? "dir-long" : "dir-short"}>{t.dir}</span></td>
                  <td style={{ fontFamily: "var(--font-mono)", fontSize: 12 }}>{t.entry}</td>
                  <td style={{ fontFamily: "var(--font-mono)", fontSize: 12 }}>{t.exit}</td>
                  <td><span className={t.pnl >= 0 ? "pnl-pos" : "pnl-neg"}>{t.pnl >= 0 ? "+" : ""}${t.pnl}</span></td>
                  <td style={{ fontFamily: "var(--font-mono)", fontSize: 12, color: parseFloat(t.rr) > 0 ? "var(--accent)" : "var(--red)" }}>{t.rr}</td>
                  <td><span style={{ fontSize: 12, color: "var(--muted)" }}>{t.strategy}</span></td>
                  <td><span style={{ fontSize: 12 }}>{t.emotion}</span></td>
                  <td>
                    <div className="score-bar">
                      <span className={`ai-score ${t.aiScore >= 7 ? "ai-high" : t.aiScore >= 5 ? "ai-mid" : "ai-low"}`}>{t.aiScore}</span>
                      <div className="score-bg"><div className="score-fill" style={{ width: `${t.aiScore * 10}%` }} /></div>
                    </div>
                  </td>
                  <td>{t.mistake ? <span className="mistake-tag">{t.mistake}</span> : <span style={{ color: "var(--muted)", fontSize: 12 }}>â€”</span>}</td>
                  <td>
                    {t.screenshotUrl ? (
                      <div style={{ position: 'relative' }}>
                        <img
                          src={t.screenshotUrl}
                          alt="Trade screenshot"
                          style={{
                            width: "40px",
                            height: "40px",
                            objectFit: "cover",
                            borderRadius: "4px",
                            cursor: "pointer",
                            border: "1px solid var(--border)"
                          }}
                          onError={(e) => {
                            console.error('Failed to load screenshot:', e);
                            e.target.style.display = 'none';
                          }}
                          onClick={() => {
                            // Create a modal to show full screenshot
                            const modal = document.createElement('div');
                            modal.style.cssText = `
                              position: fixed;
                              top: 0;
                              left: 0;
                              width: 100%;
                              height: 100%;
                              background: rgba(0,0,0,0.8);
                              display: flex;
                              align-items: center;
                              justify-content: center;
                              z-index: 10000;
                              cursor: pointer;
                            `;
                            modal.innerHTML = `
                              <img src="${t.screenshotUrl}" style="max-width: 90%; max-height: 90%; object-fit: contain; border-radius: 8px;" />
                            `;
                            modal.onclick = () => document.body.removeChild(modal);
                            document.body.appendChild(modal);
                          }}
                          title="Click to view full screenshot"
                        />
                        <div style={{
                          position: 'absolute',
                          bottom: '2px',
                          right: '2px',
                          background: 'var(--accent)',
                          color: 'white',
                          borderRadius: '50%',
                          width: '12px',
                          height: '12px',
                          fontSize: '8px',
                          display: 'flex',
                          alignItems: 'center',
                          justifyContent: 'center'
                        }}>
                          ðŸ“·
                        </div>
                      </div>
                    ) : (
                      <span style={{ color: "var(--muted)", fontSize: 12 }}>â€”</span>
                    )}
                  </td>
                  <td>
